import React, { useState } from 'react';
import SubsPlan from '../subsplan/SubsPlan.jsx';
import './Card.css';
import time from '../../assets/t.svg';
import razorpay from '../../assets/card.svg';

const Card = () => {
  const [active, setActive] = useState('p2');
  const [totalFee, setTotalFee] = useState(18500);
  const [total, setTotal] = useState('₹18500'); // Initialize as a string
  const gst = 0.18; // 18% GST

  const handleClick = (price) => {
    setActive(price.id);
    setTotalFee(price.totalFee);
    setTotal(`₹${price.total}`); // Convert to a string with ₹ symbol
  };

  const plans = [
    { id: 'p1', heading: '12 Months Subscription', mPrice: '₹8', tPrice: '₹99', rec: false, expired: true, totalFee: 9900 },
    { id: 'p2', heading: '12 Months Subscription', mPrice: '₹15', tPrice: '₹179', rec: true, expired: false, totalFee: 17900 },
    { id: 'p3', heading: '6 Months Subscription', mPrice: '₹25', tPrice: '₹149', rec: false, expired: false, totalFee: 14900 },
    { id: 'p4', heading: '3 Months Subscription', mPrice: '₹33', tPrice: '₹99', rec: false, expired: false, totalFee: 9900 }
  ];

  const subtotal = Number(total.substring(1));
  const gstAmount = subtotal * gst;
  const totalPrice = subtotal + gstAmount;

  return (
    <div className="right-box">
      <div className="entry-step">
        <div className="entry-step1">
          <button>1</button>
          <p>Sign Up</p>
        </div>
        <div className="entry-step2">
          <button>2</button>
          <p>Subscribe</p>
        </div>
      </div>

      <div className="right-box-head">
        <h3>Select your subscription plan</h3>
      </div>

      <div className="subs-plan">
        {plans.map(plan => (
          <SubsPlan
            key={plan.id}
            id={plan.id}
            heading={plan.heading}
            mPrice={plan.mPrice}
            tPrice={plan.tPrice}
            rec={plan.rec}
            active={active}
            setActive={handleClick}
            tot={`₹${plan.total}`}
            setTot={setTotal}
            expired={plan.expired}
          />
        ))}
      </div>

      <div className='total-div'>
        <div className="sub-fee-container">
          <p className='sub-head'>Subscription Fee</p>
          <p className="sub-fee">₹{totalFee}</p>
        </div>
        <div className="ltd-time-container">
          <div className="ltd-title">
            <p className="ltd-head">Limited time offer</p>
            <div className="ltd-subhead">
              <img src={time} alt="ltd-time" stroke='#000' />
              <p className="ltd-subhead-txt"><span></span> Offer valid till 25th March 2023 </p>
            </div>
          </div>

          <div className='ltd-price'>
            <p className='ltd-price-p'>-₹ {totalFee - Number(total.substring(1))}</p>
          </div>
        </div>
        <div className="total-fee-container">
          <p className='total-head'><strong>Total </strong>(Incl. of 18% GST)</p>
          <p className="total-fee">{totalPrice.toFixed(2)}</p>
        </div>
      </div>

      <div className='button'>
        <button className='cancel-button'>Cancel</button>
        <button className='proceed-button'>Proceed to Pay</button>
      </div>
      <div className='image'>
        <img alt="" src={razorpay}></img>
      </div>
    </div>
  )
}

export default Card;
